  `form` char(10) NOT NULL DEFAULT '-' COMMENT '来自那张表',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除（0未删1删除）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=160 DEFAULT CHARSET=utf8;

